import { combineReducers } from 'redux';

import auth from './auth/reducer';
import admin from './admin/reducer';
import homeCategory from './homeCategory/reducer';
import qBankMainCategory from './qBankMainCategory/reducer';
import qBankSubCategory from './qBankSubCategory/reducer';
import DashboardCategory from './DashboardCategory/reducer';
import Coupon from './Coupon/reducer';
import Student from './Student/reducer';
import Testimonials from './Testimonials/reducer';
import Announcements from './Announcements/reducer';
import questions from './questions/reducer';
import State from './State/reducer'
import ExaminationCalendar from './ExaminationCalendar/reducer'
import Exams from './exams/reducer'
export default combineReducers({
    auth,
    admin,
    homeCategory,
    qBankMainCategory,
    qBankSubCategory,
    DashboardCategory,
    Coupon,
    Student,
    Testimonials,
    Announcements,
    questions,
    State,
    ExaminationCalendar,
    Exams
});
